async function mintToken(){
  //let data = base64_encode("/Users/fenilshah/Desktop/Hackathon/react-wordle/src/test.gif")
  let data = ""
  const imageFile = new Moralis.File(data);
  await imageFile.saveIPFS();
  const imageURI = imageFile.ipfs();
  const metadata = {
    "name":"Wordle",
    "description":"Wordle NFT",
    "image":imageURI
  }
  const metadataFile = new Moralis.File("metadata.json", {base64 : btoa(JSON.stringify(metadata))});
  await metadataFile.saveIPFS();
  const metadataURI = metadataFile.ipfs();
  const encodedFunction = Moralis.Web3.eth.abi.encodeFunctionCall({
    name: "mintToken",
    type: "function",
    inputs: [{
      type: 'string',
      name: 'tokenURI'
      }]
  }, [metadataURI]);

  const transactionParameters = {
    to: nft_contract_address,
    from: Moralis.Web3.ethereum.selectedAddress,
    data: encodedFunction
  };
  const txt = await Moralis.Web3.ethereum.request({
    method: 'eth_sendTransaction',
    params: [transactionParameters]
  });
  return txt
}

